verify_msg(Msg) when tuple_size(Msg) >= 1 -> verify_msg(Msg, element(1, Msg), []);
verify_msg(X) -> mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName) when is_atom(MsgName) -> verify_msg(Msg, MsgName, []);
verify_msg(Msg, Opts) when tuple_size(Msg) >= 1 -> verify_msg(Msg, element(1, Msg), Opts);
verify_msg(X, _Opts) -> mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      connect_active_s2c -> v_msg_connect_active_s2c(Msg, [MsgName], TrUserData);
      role_login_c2s -> v_msg_role_login_c2s(Msg, [MsgName], TrUserData);
      p_machineInfo -> v_msg_p_machineInfo(Msg, [MsgName], TrUserData);
      role_reconnect_c2s -> v_msg_role_reconnect_c2s(Msg, [MsgName], TrUserData);
      role_reconnect_s2c -> v_msg_role_reconnect_s2c(Msg, [MsgName], TrUserData);
      reset_gw_mid_c2s -> v_msg_reset_gw_mid_c2s(Msg, [MsgName], TrUserData);
      create_role_c2s -> v_msg_create_role_c2s(Msg, [MsgName], TrUserData);
      create_role_s2c -> v_msg_create_role_s2c(Msg, [MsgName], TrUserData);
      role_login_s2c -> v_msg_role_login_s2c(Msg, [MsgName], TrUserData);
      role_info_s2c -> v_msg_role_info_s2c(Msg, [MsgName], TrUserData);
      p_roleInfo -> v_msg_p_roleInfo(Msg, [MsgName], TrUserData);
      role_logout_c2s -> v_msg_role_logout_c2s(Msg, [MsgName], TrUserData);
      role_logout_s2c -> v_msg_role_logout_s2c(Msg, [MsgName], TrUserData);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


